import React, {Component} from 'react';
import {
    StyleSheet,
    TabBarIOS,
    MapView
} from 'react-native';
import {bind} from '../utils/utils';

import QuakesTab from './QuakesTab';
import NewsTab from './NewsTab';
import MapViewTab from './MapViewTab';

const quakesIcon = 'data:image/png;base64,';
const newsIcon = 'data:image/png;base64,';
const mapIcon = 'data:image/png;base64,';
class App extends Component {
    constructor(props, context) {
        super(props, context);
        this.state = {
            selectedTab: 'quakes'
        };
        bind(this)('mapOnPress', 'quakesOnPress', 'newsOnPress');
    }

    quakesOnPress() {
        this.setState({
            selectedTab: 'quakes'
        })
    }

    newsOnPress() {
        this.setState({
            selectedTab: 'news'
        })
    }

    mapOnPress() {
        this.setState({
            selectedTab: 'map'
        })
    }


    render() {
        return (
            <TabBarIOS selectedTab={this.state.selectedTab}>
                <TabBarIOS.Item
                    title="Map"
                    selected={this.state.selectedTab === 'map'}
                    icon={{url: mapIcon, scale: 14}}
                    onPress={this.mapOnPress}>
                    <MapViewTab/>
                </TabBarIOS.Item>
                <TabBarIOS.Item
                    title="Quakes"
                    selected={this.state.selectedTab === 'quakes'}
                    icon={{url: quakesIcon, scale: 5}}
                    badge="15"
                    onPress={this.quakesOnPress}>
                    <QuakesTab/>
                </TabBarIOS.Item>
                <TabBarIOS.Item
                    title="News"
                    selected={this.state.selectedTab === 'news'}
                    icon={{url: newsIcon, scale: 14}}
                    badge="15"
                    onPress={this.newsOnPress}>
                    <NewsTab/>
                </TabBarIOS.Item>
            </TabBarIOS>
        )
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#F5FCFF',
    },
    welcome: {
        fontSize: 20,
        textAlign: 'center',
        margin: 10,
    },
    instructions: {
        textAlign: 'center',
        color: '#333333',
        marginBottom: 5,
    },
});

export default App;